import React from 'react';
import './header.css';
import Emblem from '../../../media/logo-img.png';
import {Container, Row, Col, Image} from 'react-bootstrap';

function header() {
    return (
        <>
        <header className = "header d-flex align-items-end justify-content-center" id = "home">
            <Container>
                <Row>
                    <Col className = "pt-5 d-flex justify-content-center">
                        <Image src = {Emblem} fluid></Image>
                    </Col>
                </Row>   
            </Container>  
        </header>
        <svg viewBox="0 0 500 150" preserveAspectRatio="none" className = "wave-svg">
        <path className="w1"  d="m-1.2 155.9c0 0 45.8-1.8 68.7-0.8 96.9 4.3 213.1 15.7 289.6 28.9 120 19 241.7 41.5 361.7 62.8 120 21.7 269.8 29.2 389.8 2.9C1228.6 222.9 1320 108 1380 76l60-32v224l-60 52-293-1.1H734L363.5 317.2 75.8 322.4 0 268c0 0-1.2-81.2-1.2-112.1z"/>
  
        <path className="w2"   d="m-1.2 186.8c0 0 45-1.1 67.5-2 190.8-7.9 184.4-4 297.5 2 120 5.3 241.2 42.3 361.2 63.6 120 21.7 245 23 365-3.3 120-26.7 194-95.4 290.1-145.1 20.1-10.4 60-32 60-32V294H1380 1080 720 360 60 0Z" />

        <path className="w3" d="M0 224 60 213.3C120 203 228.9 182.5 348.9 188.2 468.9 193.5 600 224 720 245.3 840 267 960 277 1080 250.7 1200 224 1320 160 1380 128l60-32V320H1380 1080 720 360 60 0Z" />
        </svg>
        </>
    )
}

export default header
